// src/App.js

import React, { useState } from 'react';
import '../src/app.css';
import ProductCard from './components/ProductCard';
import Cart from './Cart'; // Добавим компонент корзины

function App() {
  const [cart, setCart] = useState([]); // Состояние корзины

  // Список продуктов
  const products = [
    { id: 1, name: 'Washing Machine', price: 599.99, image: 'https://via.placeholder.com/300x200', description: 'High-efficiency washing machine with quick wash options.' },
    { id: 2, name: 'Refrigerator', price: 899.99, image: 'https://via.placeholder.com/300x200', description: 'Smart refrigerator with energy-saving features.' },
    { id: 3, name: 'Microwave Oven', price: 199.99, image: 'https://via.placeholder.com/300x200', description: 'Compact and powerful microwave for your kitchen.' }
  ];

  // Функция для добавления товара в корзину
  const handleAddToCart = (product) => {
    setCart([...cart, product]);
  };

  return (
    <div className="App">
      <header>
        <nav>
          <ul className="nav-links">
            <li><a href="#">Home</a></li>
            <li><a href="#products">Products</a></li>
            <li><a href="#about">About Us</a></li>
            <li><a href="#contact">Contact Us</a></li>
            <li><a href="#cart" className="cart-link">Cart ({cart.length})</a></li>
          </ul>
        </nav>
      </header>

      <main>
        <section id="products" className="products">
          <h2>Our Top Products</h2>
          <div className="product-cards">
            {products.map((product) => (
              <ProductCard
                key={product.id}
                product={product}
                onAddToCart={handleAddToCart}
              />
            ))}
          </div>
        </section>

        {/* Корзина */}
        <Cart cart={cart} />
      </main>

      <footer>
        <div className="footer-content">
          <section>
            <h3>Quick Links</h3>
            <ul>
              <li><a href="#">Home</a></li>
              <li><a href="#products">Products</a></li>
              <li><a href="#about">About Us</a></li>
              <li><a href="#contact">Contact Us</a></li>
            </ul>
          </section>
          <section>
            <h3>Follow Us</h3>
            <a href="#">Facebook</a> | <a href="#">Instagram</a> | <a href="#">Twitter</a>
          </section>
        </div>
        <div className="footer-bottom">
          <p>&copy; 2025 Household Appliances. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
}

export default App;
